import React from 'react';
import { Link } from 'react-router-dom';

const users = [
  {
    id: 1,
    name: 'John Doe',
    major: 'Computer Science',
    school: 'Stetson University',
    employmentStatus: 'Employed',
    location: 'Deland, FL',
    profilePhoto: '/path/to/photo1.jpg', // Use a relative path to the image
  },
  {
    id: 2,
    name: 'Jane Smith',
    major: 'English Literature',
    school: 'Stetson University',
    employmentStatus: 'Unemployed',
    location: 'Orlando, FL',
    profilePhoto: '/path/to/photo2.jpg',
  },
  // Add more users here
];

const User = () => {
  return (
    <div className="container mt-5">
      <h1>Users</h1>
      <div className="row">
        {users.map((user) => (
          <div key={user.id} className="col-md-4 mb-4">
            <div className="card">
              <img
                src={user.profilePhoto}
                alt={user.name}
                className="card-img-top"
                style={{ height: '200px', objectFit: 'cover' }}
              />
              <div className="card-body">
                <h5 className="card-title">{user.name}</h5>
                <p className="card-text">
                  Major: {user.major}<br />
                  School: {user.school}<br />
                  Employment Status: {user.employmentStatus}<br />
                  Location: {user.location}
                </p>
                <Link to={`/user/${user.id}`} className="btn btn-primary">View Profile</Link>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default User;
